import Navbar from './Navbar'

const About = () => {
  return (
    <div>
      <Navbar />
      <div>At art.of.flavours, we believe that cooking is not just about preparing food; it's a creative and fulfilling experience that brings people together. Whether you're a seasoned chef or an enthusiastic home cook, our platform is designed to inspire, educate, and delight you in the world of culinary exploration.
      At art.of.flavours, we believe that cooking is not just about preparing food; it's a creative and fulfilling experience that brings people together. Whether you're a seasoned chef or an enthusiastic home cook, our platform is designed to inspire, educate, and delight you in the world of culinary exploration.
      </div>
    </div>
  )
}
export default About
